import React from 'react'

const Footer = () => {
  return (
    <div className="text-center bg-light py-4">
      <h6>Chào mừng tới với trang luật của Hạnh</h6>
      <p> Copyright &copy; 2021</p>
    </div>
  )
}

export default Footer
